  import HackIcon1 from "../components/HackIcon1";
  import styles from './MacBookPro161.module.css';



const MacBookPro161 = () => {



  return (<main className={styles.macBookPro161}><div className={styles.takenFromThe2023Catalogue}>{`*taken from the 2023 catalogue `}</div><div className={styles.hours14Div}>Hours: 14</div><div className={styles.inProgressDiv}>In-Progress</div><div className={styles.nextSemesterDiv}>[Next Semester]</div><div className={styles.avaliableClasses}><div className={styles.avaliableClassesDiv}>{`Avaliable classes `}</div><div className={styles.mATH2090Div}><div className={styles.rectangleDiv} /><div className={styles.bIO1002Div}>MATH 2090</div></div><div className={styles.eNGLDiv}><div className={styles.rectangleDiv1} /><div className={styles.eNGL2000Div}>ENGL 2000</div></div><div className={styles.cSC3102Div}><img className={styles.rectangleIcon} alt="" src="../rectangle-8.svg" /><div className={styles.cSC3102Div1}>CSC 3102</div></div><div className={styles.cSC3501Div}><img className={styles.rectangleIcon} alt="" src="../rectangle-8.svg" /><div className={styles.cSC3102Div1}>CSC 3501</div></div><div className={styles.techElectiveA}><div className={styles.rectangleDiv} /><div className={styles.techElectiveA1}>{`Gen Art `}</div><div className={styles.lineDiv} /><img className={styles.polygonIcon} alt="" src="../polygon-1.svg" /><img className={styles.polygonIcon1} alt="" src="../polygon-2.svg" /></div><div className={styles.gENARTDiv}><div className={styles.rectangleDiv} /><div className={styles.aRTDiv}>Tech Elective A</div><div className={styles.lineDiv} /><img className={styles.polygonIcon} alt="" src="../polygon-1.svg" /><img className={styles.polygonIcon3} alt="" src="../polygon-2.svg" /></div><div className={styles.gENEDHUMANITY}><div className={styles.rectangleDiv} /><div className={styles.humanityDiv}>{`GEN ED HUMANITY `}</div><div className={styles.lineDiv} /><img className={styles.polygonIcon} alt="" src="../polygon-1.svg" /><img className={styles.polygonIcon5} alt="" src="../polygon-2.svg" /></div></div><div className={styles.blockedClasses}><div className={styles.cSC3380Div}><img className={styles.rectangleIcon} alt="" src="../rectangle-82.svg" /><div className={styles.cSC3380Div1}>CSC 3380</div></div><div className={styles.cSC2262Div}><img className={styles.rectangleIcon} alt="" src="../rectangle-82.svg" /><div className={styles.cSC3380Div1}>CSC 2262</div></div><div className={styles.cSC3304Div}><img className={styles.rectangleIcon} alt="" src="../rectangle-82.svg" /><div className={styles.cSC3380Div1}>CSC 3304</div></div><div className={styles.cSC3304Div2}><img className={styles.rectangleIcon} alt="" src="../rectangle-82.svg" /><div className={styles.cSC3380Div1}>CSC 3200</div></div></div><div className={styles.cSC2259Div}><img className={styles.rectangleIcon} alt="" src="../rectangle-86.svg" /><div className={styles.cSC3102Div1}>CSC 2259</div></div><div className={styles.mATH1552Div}><div className={styles.rectangleDiv5} /><div className={styles.bIO1002Div}>MATH 1552</div></div><div className={styles.cSC1351Div}><div className={styles.rectangleDiv5} /><div className={styles.cSC1351Div1}>CSC 1351</div></div><div className={styles.eNGL1001Div}><div className={styles.rectangleDiv5} /><div className={styles.eNGL1001Div1}>ENGL 1001</div></div><div className={styles.submitButtonDiv}><div className={styles.rectangleDiv8} /><div className={styles.submitDiv}>submit</div></div><div className={styles.bIO1001Div}><div className={styles.rectangleDiv9} /><div className={styles.bIO1001Div1}>BIO 1001</div></div><div className={styles.cSC1350Div}><div className={styles.rectangleDiv10} /><div className={styles.cSC1350Div1}>CSC 1350</div></div><div className={styles.aSTR1101Div}><div className={styles.rectangleDiv10} /><div className={styles.aSTR1101Div1}>ASTR 1101</div></div><div className={styles.mATH1550Div}><div className={styles.rectangleDiv10} /><div className={styles.aSTR1101Div1}>MATH 1550</div></div><img className={styles.lineIcon} alt="" src="../line-2.svg" /><img className={styles.lineIcon1} alt="" src="../line-4.svg" /><img className={styles.lineIcon2} alt="" src="../line-1.svg" /><div className={styles.completedDiv}>Completed</div><div className={styles.classesBlockedByPrereqs}>Classes Blocked by Prereqs</div><div className={styles.softwareEngineeringCSCSEG}>Software Engineering (CSC SEG)</div><HackIcon1 /></main>);
}

export default MacBookPro161
